import {useState} from "react"

export const MainMenu = () => {

    const [timestamp, setTimestamp] = useState(new Date())

    setTimeout(() => {
        const now = new Date()
        setTimestamp(now)
    }, 1000)

    // add name of current project to ul
    return <ul>

        <li>
            {timestamp.toLocaleTimeString()}
        </li>
        <li>Time</li>
        <li>Projects</li>
        <li>Reports</li>
    </ul>
}
